import { GET_ZHEIMER_ERROR, GET_ZHEIMER_SUCCESS } from "./actionTypes";
import Axios from "axios";

export const getZheimers = () => {
  return async (dispatch) => {
    try {
      const result = await Axios.get("/api/zheimers");
      dispatch({ type: GET_ZHEIMER_SUCCESS, payload: result.data });
    } catch (error) {
      dispatch({ type: GET_ZHEIMER_ERROR, error });
    }
  };
};
